import logo from './logo.svg';
import './App.css';
import FileUploadForm from './components/FileUploadForm';
import FileList from './components/FileList';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <FileUploadForm/>
        <FileList/>
      </header>
    </div>
  );
}

export default App;
